css:
atom-workspace .horizontal .vertical {
  position: relative;
}
background-tips {
  display: block;
}
background-tips ul {
  -webkit-user-select: none;
  cursor: default;
}
background-tips ul li {
  opacity: 0;
  padding: 0 30px;
  transition: opacity .3s;
}
background-tips ul li .keystroke {
  border: 2px solid;
  padding: 0 5px;
  border-radius: 6px;
  font-family: "Helvetica Neue", Arial, sans-serif;
}
background-tips .fade-in {
  opacity: 1;
}
